import Nav from "./components/Nav";
import Main from "./components/Main";
import { Routes, Route } from "react-router-dom";
const App = () => {
  return <div>
    <Nav/>
    <Routes>
      <Route path="/" element={<Main/>}>
         <Route />
      </Route>
    </Routes>
  </div>;
};

export default App;
